// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./libs/rlp/RLPReader.sol";

contract HeaderDecoder {
    using RLPReader for bytes;
    using RLPReader for RLPReader.RLPItem;

    event DecodedHeader(bytes32 headerHash);

    event BasicHeaderDecoded(
        bytes32 parentHash,
        bytes32 uncleHash,
        address coinbase,
        bytes32 stateRoot,
        bytes32 txHash,
        bytes32 receiptHash
    );

    struct BasicHeader {
        bytes32 parentHash;
        bytes32 uncleHash;
        address coinbase;
        bytes32 stateRoot;
        bytes32 txHash;
        bytes32 receiptHash;
    }


    event ExtendedHeaderDecoded(
        bytes logsBloom,
        uint256 difficulty,
        uint256 number,
        uint256 gasLimit,
        uint256 gasUsed,
        uint256 timestamp,
        bytes extraData,
        bytes32 mixDigest,
        uint64 nonce,
        uint256 baseFee
    );

    struct ExtendedHeader {
        bytes logsBloom;
        uint256 difficulty;
        uint256 number;
        uint256 gasLimit;
        uint256 gasUsed;
        uint256 timestamp;
        bytes extraData;
        bytes32 mixDigest;
        uint64 nonce;
        uint256 baseFee; // Optional
    }

    function decodeHeader(bytes memory rlpEncodedHeader) public {
        // Decode and emit results in smaller steps to avoid stack overflow
        BasicHeader memory basic = _decodeBasicHeader(rlpEncodedHeader);
        ExtendedHeader memory extended = _decodeExtendedHeader(rlpEncodedHeader);

        // Calculate and emit the header hash
        bytes32 headerHash = _calculateHeaderHash(basic, extended);
        emit DecodedHeader(headerHash);
    }

    function _decodeBasicHeader(bytes memory rlpEncodedHeader) internal returns (BasicHeader memory basic) {
        // Decode the basic fields
        RLPReader.RLPItem[] memory items = rlpEncodedHeader.toRlpItem().toList();

        basic.parentHash = bytes32(items[0].toBytes());
        basic.uncleHash = bytes32(items[1].toBytes());
        basic.coinbase = address(bytes20(items[2].toAddress()));
        basic.stateRoot = bytes32(items[3].toBytes());
        basic.txHash = bytes32(items[4].toBytes());
        basic.receiptHash = bytes32(items[5].toBytes());
                // Emit the BasicHeader fields
        emit BasicHeaderDecoded(
            basic.parentHash,
            basic.uncleHash,
            basic.coinbase,
            basic.stateRoot,
            basic.txHash,
            basic.receiptHash
        );
    }

    function _decodeExtendedHeader(bytes memory rlpEncodedHeader) internal returns (ExtendedHeader memory extended) {
        // Decode the extended fields
        RLPReader.RLPItem[] memory items = rlpEncodedHeader.toRlpItem().toList();

        extended.logsBloom = items[6].toBytes();
        extended.difficulty = items[7].toUint();
        extended.number = items[8].toUint();
        extended.gasLimit = items[9].toUint();
        extended.gasUsed = items[10].toUint();
        extended.timestamp = items[11].toUint();
        extended.extraData = items[12].toBytes();
        extended.mixDigest = bytes32(items[13].toBytes());
        extended.nonce = uint64(items[14].toUint());

        if (items.length > 15) {
            extended.baseFee = items[15].toUint();
        }

                // Emit the decoded fields
        emit ExtendedHeaderDecoded(
            extended.logsBloom,
            extended.difficulty,
            extended.number,
            extended.gasLimit,
            extended.gasUsed,
            extended.timestamp,
            extended.extraData,
            extended.mixDigest,
            extended.nonce,
            extended.baseFee
        );
    }

    function _calculateHeaderHash(BasicHeader memory basic, ExtendedHeader memory extended) internal pure returns (bytes32) {
        // Hash the combined fields
        return keccak256(
            abi.encodePacked(
                basic.parentHash,
                basic.uncleHash,
                basic.coinbase,
                basic.stateRoot,
                basic.txHash,
                basic.receiptHash,
                extended.logsBloom,
                extended.difficulty,
                extended.number,
                extended.gasLimit,
                extended.gasUsed,
                extended.timestamp,
                extended.extraData,
                extended.mixDigest,
                extended.nonce
                // Exclude baseFee for legacy headers if it's not present
            )
        );
    }
}

